import user from '../../assets/test/User.svg'
import s from './style.module.css'

export function SmallCardUser() {
	return (
		<div className={s.container}>
			<img className={s.img} src={user} alt='user'/>
			<div className={s.infoUser}>Test</div>
		</div>
	);
}
